import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./index.css"
import CanvasComponent from "./components/Canvas";

const root = ReactDOM.createRoot(document.getElementById("root"));

// Création des éléments canvas et div
const canvasElement = <canvas id="canvas"></canvas>;
const infoDivElement = <div id="info">Click & Drag for new Colors</div>;

// Rendu des éléments dans le root React
root.render(
    <React.StrictMode>
        {canvasElement}
        {infoDivElement}
        <App />
        <CanvasComponent/>
    </React.StrictMode>
);
